(37, 'Edificios Gimnasio Moderno', 4.659102503723288, -74.05606070659496, 'El conjunto de edificios que conforman el Gimnasio Moderno fue proyectado por el arquitecto estadounidense Robert M. Farrington. El grupo central dispuesto simétricamente alrededor de una espacio libre con sus volúmenes en ladrillo y tejas de barro recuer', 1, 0, '', '', ''),
