(50, 'Escultura la Rebeca', 4.612237191998518, -74.07145122192242, 'Obra de Roberto Henao Buriticá. La escultura en mármol es fiel a la tendencia neoclásica que se presentó en el país a principios de siglo XX. Representa a una aguadora desnuda junto a un estanque llevando en sus manos un cuenco y un cántaro. Dice Mercedes', 1, 0, '', '', ''),
