(55, 'Escultura Minerva', 4.596723903875411, -74.0728178074155, 'Escultura en bronce ubicada a la entrada de la biblioteca Luis Ángel Arango. Tal como la representaban los romanos aparece de pie, vestida con túnica, la cabeza protegida por casco, lleva en la mano derecha lanza y escudo y en la izquierda un ramo de oliv', 1, 0, '', '', ''),
