(1571, 'Museo Casa Museo Jorge Eliécer Gaitán', 4.630272550813522, -74.06909624240734, 'Es la casa donde vivió su vida de casado allí aún se conservan las pertenencias y la historia del líder popular. Allí se guarda el arma con que fueron realizados los disparos, los casquillos de las balas, la agenda donde tenia anotada una cita que tenia e', 1, 0, '', '', ''),
(1572, 'Museo de Arte Colonial', 4.595869694045829, -74.07546917102673, 'La colección del Museo ocupa una casa construida en 1694 y esta conformada por piezas obtenidas de antiguo Museo Histórico Nacional. La muestra reúne pinturas, tallas, objetos cotidianos y muebles de la epoca, además de una colección de más de 100 obras d', 1, 0, '', '', ''),
(1573, 'Museo de Arte Contemporáneo', 4.698731064427995, -74.09066120288708, '', 1, 0, '', '', ''),
(1574, 'Museo de Arte del Banco de La República', 4.596725240666233, -74.07311955592968, '', 1, 0, '', '', ''),
(1575, 'Museo de Arte Moderno de Bogotá - MAMBO', 4.610445929135932, -74.06922498844006, 'Fue construido por Rogelio Salmona, se inauguro en 1979, aunque el museo había sido creado en 1955 y comenzó actividades en 1963. tiene un área de 5300 metros cuadrados distribuidos en 4 niveles y 7 salas. Su colección alcanza las 2500 piezas.', 1, 0, '', '', ''),
(1576, 'Museo de Arte y Cultura', 4.622551569896664, -74.0647832503114, '', 1, 0, '', '', ''),
(1577, 'Museo de Bogotá - Casa del Virrey Juan Sámano', 4.595281505148619, -74.0734843363557, 'El lugar fue restaurado recientemente para albergar la sede del Museo. Concebido inicialmente como un recinto enfocado a mostrar las transformaciones de la ciudad, también promueve ahora actividades como exposiciones temporales que cuentan con el concurso', 1, 0, '', '', ''),
(1578, 'Museo de La Independencia - Casa del Florero', 4.598243833387696, -74.0751043906007, 'La casa es una muestra de la arquitectura hispanomudéjar de los siglos XVI y XVII. Se caracteriza por sus muros blancos. Para su construcción se emplearon materiales autóctonos de la zona, como el barro, cal, y piedra. La casa guarda unos mil objetos reun', 1, 0, '', '', ''),
(1579, 'Museo de Los Niños', 4.661134243730239, -74.08879438541271, 'Desde 1987, el Museo de los Niños empieza con un recorrido de aproximadamente hora y media por 25 módulos repartidos en más de 8.000 metros cuadrados de construcción. En ellos se abordan distintas áreas de la actividad y el conocimiento humano: mécanica, ', 1, 0, '', '', ''),
(1580, 'Museo de Marionetas de Jaime Manzur ', 4.648109619187975, -74.06506220004894, 'Fundado en 1980 . En el vestíbulo hay una curiosa exhibición de marionetas, vestuario y utilería proveniente de diversos lugares del mundo.', 1, 0, '', '', ''),
(1581, 'Museo de Suelos de Colombia', 4.638378420713458, -74.07890239856579, '', 1, 0, '', '', ''),
(1582, 'Museo de Trajes Regionales de Colombia', 4.596800100946657, -74.0749971022401, 'Los atuendos son principalmente de origen campesino y fueron usados hasta mediados del Siglo XIX por los pobladores de diferentes regiones del país. Pero la colección no sólo se detiene en la indumentaria, nos muestra la diversidad étnica del país, a trav', 1, 0, '', '', ''),
(1583, 'Museo del Cobre', 4.601623225289832, -74.07235780856945, '', 1, 0, '', '', ''),
(1584, 'Museo del Mar', 4.606777836467011, -74.06769076488354, '', 1, 0, '', '', ''),
(1585, 'Museo del Siglo XIX', 4.594458039877146, -74.07879511020519, 'Se exponen numerosos objetos que dan cuenta de la vida cotidiana en el siglo XIX. Hacen parte de la colección vestidos para mujeres embarazadas, escupideras, carteles comerciales, muñecas y una botica completa con sus frascos marcados con nombres, como ár', 1, 0, '', '', ''),
(1586, 'Museo El Chicó', 4.672875447158301, -74.04457012317516, 'Se construye como museo y parque infantil en 1964, a partir de la voluntad testamentaria de su dueña. Su colección de arte de los siglos XVIII y XIX que incluye imaginería y pintura colonial, cerámica precolombina y mobilario francés, entre otros. Los bel', 1, 0, '', '', ''),
(1587, 'Museo El Oficio del Cuero y Los Años 40 ', 4.636731589235824, -73.96655002734997, '', 1, 0, '', '', ''),
(1588, 'Museo Exposición El Hombre', 4.615771580990716, -74.07752910755016, '', 1, 0, '', '', ''),
(1589, 'Museo Francisco de Paula Santander', 4.724885109330984, -74.02491489551409, 'El museo ocupa la segunda planta de la Hacienda El Cedro, cuenta con muebles, vestuario, objetos y documentos que pertenecieron al que también fue presidente de Colombia, así como piezas de interés histórico son parte de la colección donada por sus antepa', 1, 0, '', '', ''),
(1590, 'Museo Francisco José de Caldas', 4.594479428597511, -74.07879511020519, '', 1, 0, '', '', ''),
(1591, 'Museo Geológico Nacional José Royo y Gómez', 4.633865665563593, -74.08297935626842, 'Esta dotado de una sala de exposición, un auditorio y un laboratorio. La sala dedica sus 840 metros cuadrados a la exposición de unas 2.500 muestras de rocas y minerales, al igual que fósiles de cretácico y del terciario.', 1, 0, '', '', ''),
(1592, 'Museo Histórico de La Policía Nacional', 4.597816061117561, -74.07866099975445, '', 1, 0, '', '', ''),
(1593, 'Museo Iglesia de Santa Clara', 4.596917738514242, -74.07749155662395, 'El arquitecto español Matías de Santiago la construyo rntre 1620 y 1629. siguiendo las proporciones de los templos doctrineros; En el interior destaca la bóveda de medio cañón y el presbiterio.', 1, 0, '', '', ''),
