(1595, 'Museo Militar', 4.596286773151549, -74.07396713397839, 'Cuenta con más de 10.800 piezas que permiten apreciar la evolución en armas, uniformes, medios de transporte y accesorios de las fuerzas Militares de Colombia. El Museo funciona en una antigua casa que perteneció a la familia del capitán Antonio Ricaurte,', 1, 0, '', '', ''),
