(1599, 'Observatorio Astronómico', 4.596254690152075, -74.07753983638622, 'Fue construido por Fray Domingo de Pretés y José Celestino Mutis en 1803. se caracteriza por su planta octogonal con un adosado en forma cuadrada. El edificio consta de dos plantas y una azotea. La primera servía como habitación del astrónomo, y la segund', 1, 0, '', '', ''),
(1600, 'Planetario de Bogotá', 4.612221150858603, -74.06886020801403, 'Inaugurado en 1969, en ese lugar, cuya construcción duro 2 años, funcionan además la Galería Santafé y la Sala Orion Rangel. El acceso a todos estos lugares se hace por una sola puerta ubicada en la segunda planta. Los pasillos se encuentrasn acondicionad', 1, 0, '', '', ''),
(1601, 'Plaza de Toros La Santamaría', 4.61299112516601, -74.06855980060436, 'Fue bautizada así en honor a uno de sus promotores, el ganadero Ignacio Sanz Santamaría. Fue inaugurada en 1931, aunque la construcción completa, tal como se ve hoy, estuvo terminada en 1940, cuando el arquitecto Santiago Mora entregó la fachada. El lugar', 1, 0, '', '', ''),
