(1654, '2. Catedral de Sal', 4.671451069074436, -73.94253730773926, 'Considerada como uno de los logros arquitectónicos y artísticos más notables de la arquitectura colombiana a 180mts bajo tierra se le entregó el título de joya arquitectónica de la modernidad. La importancia de la Catedral, radica en su valor como patrimo', 1, 0, '', '', ''),
(1655, '3. Cerro de Monserrate', 4.621674666464581, -74.05718723438122, 'Se ubica en la zona oriental del a ciudad, con una altura de 3316 metros sobre el nivel del mar ', 1, 0, '', '', ''),
(1656, '8. Santuario del Divino Niño del 20 de Julio', 4.5683526292579915, -74.09563938281872, 'En el santuario se encuentra la imagen del Señor Caído. La iglesia colonial emplazada originalmente en 1620 fue reemplazada 300 años más tarde por la actual, además ofrece la mejor panorámica de la capital.', 1, 0, '', '', ''),
(1657, 'Altar Mayor de la Iglesia de San Francisco', 4.597013987418787, -74.07311955592968, 'Es la más antigua de Bogotá (1550- 1567) Originalmente constaba de una sola nave, pero posteriormen se te fueron anexando pequeñas capillas sobre el ala oriental.', 1, 0, '', '', ''),
(1658, 'Basílica del Voto Nacional', 4.602198041145381, -74.08215591810085, 'La Basílica es un templo moderno, construido en estilo Greco Romano casi perfecto. El templo está dispuesto en tres naves definidas por columnas y arcadas. La fachada principal es simétrica, de tres cuerpos y cinco calles, con columnas adosadas y vanos re', 1, 0, '', '', ''),
(1659, 'Capilla del Gimnasio Moderno', 4.6586106078913145, -74.0556530108247, 'La Capilla de los Santos Apóstoles del Gimnasio Moderno fue diseñada y construida en 1954 por el arquitecto Juvenal Moya. Se destaca el uso extensivo de vitrales en los tímpanos de las bóvedas y en el crucero de las naves, lo cual crea un ambiente dominad', 1, 0, '', '', ''),
(1660, 'Capilla del Gimnasio Moderno', 4.658460900395827, -74.05435482166149, 'La Capilla de los Santos Apóstoles del Gimnasio Moderno fue diseñada y construida en 1954 por el arquitecto Juvenal Moya. Se destaca el uso extensivo de vitrales en los tímpanos de las bóvedas y en el crucero de las naves, lo cual crea un ambiente dominad', 1, 0, '', '', ''),
(1661, 'Capilla del Sagrario', 4.597746548099428, -74.07547989986278, 'El templo fue construido entre 1660 a 1700, aunque hace parte de la catedral de Bogotá (Primada de Colombia) es un edificio totalmente independiente, cuenta con planta en cruz latina, de una sola nave longitudinal, a su vez atravesada por el transepto o n', 1, 0, '', '', ''),
(1662, 'Capilla del Sagrario', 4.600457550781012, -74.07572666309215, '', 1, 0, '', '', ''),
(1663, 'Capilla La Bordadita', 4.600345260934013, -74.07322952649929, '“La Bordadita” es la Virgen Patrona del Colegio Mayor, y preside la Capilla con su nombre que está ubicada al costado izquierdo del Claustro.', 1, 0, '', '', ''),
(1664, 'Capilla San Miguel del Príncipe', 4.596983241242488, -74.06974265477993, 'Capilla construida en 1969 destinada a evocar la primera misa celebrada en el territorio de lo que hoy es Bogotá. En su obra sólo se utilizaron elementos de demolición y se tomo como modelo la Ermita del Humilladero', 1, 0, '', '', ''),
(1665, 'Capilla Santa María de Los Ángeles', 4.661679604521795, -74.05027249954082, 'La pequeña capilla, concluida en 1920, se construyó tomando como modelo una iglesia francesa. Fue propiedad privada hasta 1948, cuando su dueña la dio en administración a los padres Agustinos. En la parte inferior del frontis se observa la semicúpula que ', 1, 0, '', '', ''),
(1666, 'Casa Cural de Fontibón', 4.671292855602945, -74.13512149951794, 'Construcción realizada a mediados del siglo XVII. Se destacan las columnas líticas que sostienen el balcón en madera del segundo piso. Se destaca el hecho de que en ésta casa vivió el apóstol de los negros San Pedro Claver. Tipo: Histórico Pautas de Compo', 1, 0, '', '', '');
