(1667, 'Casa Cural de la Catedral', 4.598254527691118, -74.07437482974865, 'Fray Domingo de Petrés inició la construcción de la última catedral a mediados del siglo XVIII, con fachada de estilo neoclásico. A su muerte, su discípulo Nicolás León la culminó en 1823. a finales del siglo XIX se inciaron una serie de reformas. la últi', 1, 0, '', '', ''),
(1668, 'Catedral Primada', 4.59779467249732, -74.07498637340404, 'Es la cuarta que se erigió en el mismo lugar. Fray Domingo de Petrés inició la construcción de la última catedral a mediados del siglo XVIII, con fachada de estilo neoclásico. A su muerte, su discípulo Nicolás León la culminó en 1823. a finales del siglo ', 1, 0, '', '', ''),
(1669, 'Colegio y Residencias de Las Hermanas del Santísimo Rosario', 4.595046229453812, -74.07390007875301, 'Es la sede del colegio y residencia de las Hermanas Dominicas del Santísimo Rosario Perpetuo. Tipo: Histórico Pautas de Comportamiento: Los reglamentos determinados por el colegio y la comunidad religiosa.', 1, 0, '', '', ''),
(1670, 'Escultura la Virgen del Campo', 4.612477809053829, -74.07022008798458, 'La Iglesia de San Diego o También conocida como Iglesia Nuestra Señora del Campo tiene en su interior su imagen tallada en piedra.', 1, 0, '', '', ''),
